Given that the shortest tree's height is 60 feet, and the second tree's height is 50 feet more than the shortest tree, therefore the second tree is 110 feet tall. The combined height of the first two trees is 60 feet + 110 feet = 170 feet. Therefore, the tallest tree, which is twice the height as the combined height of the first two trees, is 2 * 170 feet = 340 feet.

